import TopBar from './components/TopBar';
import Card from './components/Card';
import CardsContainer from './components/CardsContainer';
function App() {
  return (
    <>
    <TopBar/>
    <CardsContainer>
    <Card/>
    <Card/>
    <Card/>
    <Card/>
    <Card/>
    </CardsContainer>
    </>
  );
}

export default App;
